 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:30px;font-family:'Calibri';\"><B>Kelenteng See Hoo Kiong</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">Beranjak dari Kelenteng Hwie Wie Kiong. Hanya berjalan beberapa langkah ke barat. Kita akan berjumpa dengan bangunan kelenteng lain, yang tak kalah megah dengan Kelenteng Hwie Wie Kiong. Kelenteng itu adalah Kelenteng See Hoo Kiong. Pekarangan depan klenteng ini jauh lebih luas dibandingkan dengan Kelenteng Hwie Wie Kiong. Pekarangan suatu kelenteng umumnya bersifat profan, segala kegiatan masyarakat berlangsung di sini. Karena itu, pekarangan depan kelenteng harus bebas dari struktur permanen seperti pohon dan tiang. Hal lain yang dapat diperhatikan dari kelenteng ini adalah jumlah undakan yang lebih banyak. Kelenteng ini tampak lebih tinggi dibandingkan Kelenteng Hwie Wie Kiong. Ini menandakan bahwa Kelenteng See Hoo Kiong memiliki status lebih tinggi di antara kelenteng-kelenteng di Semarang.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">Di antara seluruh klenteng di Pecinan Semarang, klenteng ini adalah yang paling bungsu. Pada 1881, Liem Siong Djian dan Liem Kiem Ling memprakarsai pembangunan klenteng. Seperti tidak mau ketinggalan dengan marga Tan, mereka berdua ingin mendirikan klenteng untuk marga mereka. Demi mewujudkan pembangunan, anggota marga Liem mendermakan uangnya. Klenteng marga Liem itupun akhirnya dibangun di lahan yang masih bersebelahan dengan klenteng milik marga Tan (Liem; 1931; 174). Setelah bangunan klenteng berdiri, kemakmuran menyertai kehidupan marga Liem. Beberapa keturunan mereka sukses menjadi taipan.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">Dilihat tata ruang dan komponen bangunannya, Klenteng See Hoo Kiong bisa dikatakan sebelas-dua belas dengan Klenteng Hwie Wie Kiong. Perbedaannya hanyalah pada hiasan nan indah yang tergurat pada kayu-kayu serta ukuran bangunan. Nuansa Tiongkok masih melekat erat pada bagian luar Klenteng See Hoo Kiong, sama seperti Klenteng Tan Seng Ong yang bersanding di sebelahnya. Atap klenteng memiliki bubungan atap berbentuk seperti jurai ekor walet atai yanwei yang jadi ciri arsitektur Minnan. Di pucuk atap, bertengger dua pasang naga yang saling berhadapan menghadap sebuah bola api. Pinggiran genting pada titisan serambi diberi penutup tabung bergelasir yang disebut liuliwa. Genting semacam ini hanya diperuntukan untuk istana kekaisaran atau bangunan suci. Salah satu hiasan pembeda klenteng ini adalah mural pada ambang bagian atas pintu yang menggambarkan kisah-kisah rakyat Tiongkok yang sarat dengan hikmah dan pesan.</SPAN></SPAN></DIV></div>",
