 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:30px;font-family:'Calibri';\"><B>Kelenteng Sinar Samudra</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">Klenteng Sinar Samudra ini dibangun pada 1756 untuk memuja Tek Hay Cin Jin atau \u201cMalaikat Penolong Lautan\u201d. Tapi, Tek Hay Cin Jin ini bukan tokoh fiksi ya, Millens. Dia adalah seorang pahlawan yang memimpin perlawanan atas kesewenang-wenangan VOC. Tek Hay Cin Jin juga dikenal dengan kebaikannya kepada sesama manusia. Banyak masyarakat pribumi yang mendapatkan pertolongan dari hasil laut yang didapatkan Tek Hay Cin Jin. Oleh karena itulah, dia mendapatkan julukan Malaikat Penolong Lautan. Ada hal unik yang membedakan Klenteng Sinar Samudra dengan kelenteng lainnya. Yakni, keberadaan tempat abu arwah para leluhur Kota Semarang seperti Kwee Kiauw Khong, orang Tionghoa pertama yang diangkat menjadi kapiten di Kota Atlas pada masa penjajahan Belanda.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">Pada tahun 1832, klenteng tersebut tidak luput dari banjir sehingga mengharuskan bangunan ditinggikan sekitar 1,5 meter. Pada 1950-an, klenteng ini juga sempat difungsikan sebagai Sekolah Dasar Kristen karena tidak terawat sebelum akhirnya dikembalikan fungsinya menjadi rumah ibadah. \u201cPengembalian tersebut dilakukan oleh Tan Tjing Hok, seorang yang pernah memperoleh mukjizat kesembuhan dari penyakit stroke setelah mendapat resep buah gandaria dari Tek Hay Cin Jin lewat mimpi. Mulai tahun 1977 kepengurusan klenteng Tek Hay Bio berubah menjadi terbuka dengan masuknya pengurus-pengurus baru yang tidak berasal dari marga Kwee. Menurutnya, sejak 13 Desember 1983 klenteng Tek Hay Bio tak pelak berubah menjadi yayasan hingga sekarang. \u201cMaka, penduduk Tionghoa bermarga Kwe saat itu mendirikan klenteng ini supaya keturunannya mendapatkan berkat dari Kwe Lak Kwa.</SPAN></SPAN></DIV></div>",
