 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:30px;font-family:'Calibri';\"><B>Kelenteng Siu Hok Bio</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">Kelenteng Siu Hok Bio berada di Jalan Wotgandul Timur Nomor 38, Kelurahan Kranggan, Kecamatan Semarang Tengah, Kelenteng itu merupakan kelenteng paling tua di pecinan Semarang. Meski ukurannya tak sebesar yang lain, kelenteng tersebut menjadi saksi biksu awal mula keberadaan warga Tionghoa di pecinan Semarang. Kelenteng Siu Hok Bio sudah berdiri sejak 1416. Keberadaan Kelenteng Siu Hok Bio menjadi pertanda keberadaan warga Tionghoa di pecinan. \"Sebelumnya orang Tionghoa itu ada di kawasan Sam Poo Kong\"</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">Keberadaan Kelenteng Siu Hok Bio di pecinan Semarang juga ada campur tangan Oei Tjie Sien. Bagi warga Semarang, nama Oei Tjie Sien sudah tak asing, Oei Tjie Sien merupakan ayah Oei Tiong Ham yang dijuluki sang 'Raja Gula' terbesar di Dunia dan beliaulah yang membawa patung dewa ke Kelenteng Siu Hok Bio. Oei Tjie Sien membawa patung dewa menggunakan perahu dari China ke Kota Semarang. </SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">Oei Tjie Sien membawa Patung Dewa Bumi dari Negara China ke Kota Semarang menggunakan kapal. Sejak pertama kali berdiri, kelenteng tersebut berukuran tidak terlalu besar. Luasan bangunannya hanya sekitar 9\u00d725 meter. Saat ini kelenteng Siu Hok Bio diapit ruko besar dan masuk ke dalam cagar budaya. Bentuk bangunan tidak banyak berubah walaupun ada beberapa yang sudah direnovasi. Bagian yang paling sering dilakukan renovasi yaitu pada bagian lantai, sudah tiga kali. Sebelum pakai granit Italia dulunya lantai tersebut menggunakan pasir semen berwarna merah. </SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">Berdasarkan pemerhati Sejarah Kota Semarang, Johanes Christiono, beliau turut membenarkan bahwa kelenteng tertua di pecinan adalah Siu Hok Bio. Kelenteng tersebut menjadi tempat ibadah pertama orang Tionghoa setelah dipindahkan ke kawasan pecinan. Sedangkan yang kelenteng tertua kedua itu adalah kelenteng yang terletak di Gang Gambiran. Dulunya, warga Tionghoa dipindahkan oleh Belanda dari Gedung Bati ke kawasan yang saat ini menjadi sebuah kampung pecinan agar pengawasnya menjadi lebih mudah. \"Pada saat itu orang-orang Eropa itu melakukan perdagangan rempah-rempah di sebuah kota yang sekarang sudah berubah menjadi Kota Lama. Sementara untuk para orang Tionghoa mereka melakukan perdagangan di sebuah perkampungan yang saat ini menjadi kampung pecinan semarang\".</SPAN></SPAN></DIV></div>",
