 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:30px;font-family:'Calibri';\"><B>Kelenteng Tong Pek Bio</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">Kelenteng Tong Pek Bio adalah sebuah kelenteng yang terletak di Kampung Pecinan, Semarang, Jawa Tengah. Kelenteng ini adalah salah satu dari banyak kelenteng yang ada di daerah tersebut dan merupakan tempat ibadah bagi umat Konghucu dan Taoisme. Kelenteng ini didirikan untuk menghormati dewa Tong Pek atau Thian Siang Seng Boo, yang diyakini sebagai dewa pelindung dan pemberi berkah. Sejarah kelenteng ini erat kaitannya dengan komunitas Tionghoa di Semarang yang sudah ada sejak berabad-abad lalu. Kelenteng Tong Pek Bio memiliki arsitektur khas Tionghoa dengan ornamen dan patung-patung dewa yang indah. Bagian dalam kelenteng dihiasi dengan ukiran-ukiran kayu yang rumit dan lampion-lampion merah yang menggantung.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">Kelenteng ini menjadi pusat berbagai kegiatan keagamaan dan budaya bagi komunitas Tionghoa di Semarang. Beberapa upacara penting yang diselenggarakan di kelenteng ini antara lain:</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">- Cap Go Meh: Perayaan yang menandai akhir dari rangkaian perayaan Tahun Baru Imlek.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">- Sembahyang Rebutan (Cio Tao): Upacara sembahyang yang bertujuan untuk memperingati arwah leluhur dan roh-roh yang tidak memiliki keluarga.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">- Peringatan hari kelahiran dewa-dewi: Berbagai upacara untuk memperingati hari kelahiran dewa-dewi yang dihormati di kelenteng ini.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:15px;font-family:'Calibri';\">Kelenteng Tong Pek Bio bukan hanya tempat ibadah, tetapi juga menjadi pusat sosial dan budaya bagi masyarakat Tionghoa di Semarang. Tempat ini sering digunakan untuk berbagai kegiatan komunitas, termasuk pendidikan, seni, dan budaya. Dengan sejarah dan fungsi yang begitu penting, Kelenteng Tong Pek Bio menjadi salah satu ikon budaya dan religius di Semarang, sekaligus menjadi saksi bisu dari keberadaan dan kontribusi komunitas Tionghoa di kota ini.</SPAN></SPAN></DIV></div>",
