 "scrollBarVisible": "rollOver",
 "borderSize": 0,
 "paddingBottom": 10,
 "paddingTop": 10,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:35px;font-family:'Calibri';\"><B>Deskripsi Singkat</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:15px;font-family:'Calibri';\">Kawasan pecinan Semarang atau yang dikenal dengan chinatown Semarang, adalah sebuah kawasan bersejarah yang kaya akan budaya Tionghoa. Kawasan ini terletak di pusat kota Semarang, Jawa Tengah. Kawasan ini memiliki jejak sejarah yang panjang dan menjadi salah satu destinasi wisata yang populer bagi wisatawan lokal maupun mancanegara.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:15px;font-family:'Calibri';\">Kawasan Pecinan Semarang juga menjadi tempat untuk mempelajari sejarah Tionghoa di Indonesia. Museum Peranakan Tionghoa merupakan salah satu tempat yang wajib dikunjungi di kawasan ini. Di dalam museum ini menampilkan berbagai koleksi pakaian tradisional, perabotan rumah tangga, dan artefak lain yang menggambarkan kehidupan Peranakan Tionghoa.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:15px;font-family:'Calibri';\">Kawasan pecinan juga kerap dijadikan tuan rumah untuk perayaan budaya yang meriah, seperti Cap Go Meh. Cap Go Meh merupakan perayaan Tahun Baru Imlek yang dirayakan masyarakat Tionghoa dengan menampilkan berbagai pertunjukan seni, atraksi, dan pameran budaya. Festival ini menarik banyak pengunjung dan memberikan pengalaman unik tentang tradisi Tionghoa di Indonesia.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:15px;font-family:'Calibri';\">Selain itu, kondisi jalan yang tidak terlalu lebar di Kawasan Pecinan Semarang, membuat masyarakat Tionghoa kala itu menciptakan moda transportasi dengan memakai tenaga kuda yang disebut dengan Be Too. Masyarakat Tionghua lebih banyak melakukan aktivitas perdangangan yang berasal dari China atau Tiongkok seperti perhiasan, sutra, keramik dan lain sebagainya.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
